import "./heroImg.css";
import background from "../assests/background.jpg"

const HeroImg = () => {
    return (
        <div className="hero">
            <div className="mask">
                <img className="intro-img" src = {background} alt = "background img"></img>
            </div>
        </div>
    )
};

export default HeroImg;
